    #[doc = "             to this function should be preceded by a key-schedule via"]
    #[doc = "             mbedtls_camellia_setkey_enc() regardless of whether \\p mode"]
    #[doc = "             is #MBEDTLS_CAMELLIA_ENCRYPT or #MBEDTLS_CAMELLIA_DECRYPT."]
    #[doc = ""]
